package com.jcpt.jzg.padsystem.vo;import android.os.Parcel;import android.os.Parcelable;import com.jcpt.jzg.padsystem.base.BaseObject;import java.util.ArrayList;import java.util.List;public class ModelCategory extends BaseObject implements Parcelable {    private String ManufacturerName;    private List<Model> ModelList = new ArrayList<Model>();    public String getManufacturerName() {        return ManufacturerName;    }    public void setManufacturerName(String manufacturerName) {        ManufacturerName = manufacturerName;    }    public List<Model> getModelList() {        return ModelList;    }    public void setModelList(List<Model> modelList) {        ModelList = modelList;    }    @Override    public String toString() {        return "ModelCategory{" +                "ManufacturerName='" + ManufacturerName + '\'' +                ", ModelList=" + ModelList +                '}';    }    @Override    public int describeContents() {        return 0;    }    @Override    public void writeToParcel(Parcel dest, int flags) {        super.writeToParcel(dest, flags);        dest.writeString(this.ManufacturerName);        dest.writeTypedList(ModelList);    }    public ModelCategory() {    }    protected ModelCategory(Parcel in) {        super(in);        this.ManufacturerName = in.readString();        this.ModelList = in.createTypedArrayList(Model.CREATOR);    }    public static final Creator<ModelCategory> CREATOR = new Creator<ModelCategory>() {        public ModelCategory createFromParcel(Parcel source) {            return new ModelCategory(source);        }        public ModelCategory[] newArray(int size) {            return new ModelCategory[size];        }    };}